def simple_get(url):
    try:
        with closing(get(url, stream=True)) as resp:
            if is_good_response(resp):
                return resp.content
            else:
                return None
    except RequestException as e:
        log_error('Error during requests to {0} : {1}'.format(url, str(e)))
        return None


def is_good_response(resp):
    content_type = resp.headers['Content-Type'].lower()
    return (resp.status_code == 200 
            and content_type is not None 
            and content_type.find('html') > -1)


def log_error(e):
    print(e)


def removeExtras(arr):
	for x in range(len(arr)):
		if '  ' in arr[x]:
			arr[x] = arr[x].replace('  ', ' ')
		if ' D/ST' in arr[x]:
			arr[x] = arr[x][:-5]
		if ' Defense' in arr[x]:
			arr[x] = arr[x][:-8]
			if 'LA ' in arr[x]:
				arr[x] = 'Los Angeles ' + arr[x][3:]
			arr[x] = deCity[arr[x]]
		if arr[x] in deObject:
			arr[x] = deObject[arr[x]]
	for x in range(len(arr)):
		arr[x] = arr[x].lower()
		for char in arr[x]:
			if char in ".'":
				arr[x] = arr[x].replace(char,'')
	for x in range(len(arr)):
		for word in removeWords.keys():
			if word in arr[x].lower():
				arr[x] = arr[x].replace(word, removeWords[word])
	return arr


def cleanNames(l1,l2,l3,l4,l5):
	names = []
	for x in [l1,l2,l3,l4,l5]:
		names += x
	names = sorted(list(set(names)))
	names.pop(0)
	return names


def indexItem(start, source, x):
	try:
		return source.index(start[x]) + 1
	except:
		return '-'


def ranks(start, src2, src3, src4, src5):
	listNames = cleanNames(start, src2, src3, src4, src5)
	for x in range(len(listNames)):
		total = 0
		count = 0
		std = 0
		stdArr = []
		for y in (start, src2, src3, src4, src5):
			try:
				total += indexItem(listNames, y, x)
				count += 1
				stdArr.append(indexItem(listNames, y, x))
			except:
				pass

		avg = round(total/count,2)
		if len(stdArr) > 1:
			for z in range(len(stdArr)):
				std += (stdArr[z] - avg)**2
			std = (std/(len(stdArr) - 1))**.5
		holdArray.append({'name' : listNames[x].title(), 'key' : x, 'YAH' : indexItem(listNames, start, x), 'CBS' : indexItem(listNames, src2, x), 'ESP' : indexItem(listNames, src3, x), 'MYF' : indexItem(listNames, src4, x), 'FFC' : indexItem(listNames, src5, x), 'AVG' :avg, 'STD' :round(std,2)})
	return holdArray


def addalExtras(data):
	for x in range(len(data)):
		data[x]['team'] = alPlayerTeam[data[x]['name'].lower()]
		data[x]['bye'] = byeTeam[data[x]['team']]
		data[x]['pos'] = alPlayerPosition[data[x]['name'].lower()]
	return data


def fixPositionRanks(positionRanks):
	for source in ('YAH','CBS','ESP','MYF','FFC'):
		for x in range(len(positionRanks)):
			if positionRanks[x][source] == '-':
				positionRanks[x][source] = 999
		positionRanks = sorted(positionRanks, key=lambda k: k[source])
		for x in range(len(positionRanks)):
			if positionRanks[x][source] == 999:
				positionRanks[x][source] = '-'
			else:
				positionRanks[x][source] = x + 1


def fixPositionMetrics(positionRanks):
	for x in range(len(positionRanks)):
		total = 0
		count = 0
		std = 0
		stdArr = []
		for source in ('YAH','CBS','ESP','MYF','FFC'):
			try:
				total += positionRanks[x][source]
				count += 1
				stdArr.append(positionRanks[x][source])
			except: 
				pass
		avg = round(total/count,2)
		positionRanks[x]['AVG'] = avg
		if len(stdArr) > 1:
			for z in range(len(stdArr)):
				std += (stdArr[z] - avg)**2
			positionRanks[x]['STD'] = round((std/(len(stdArr) - 1))**.5,2)


def fixKey(positionRanks):
	positionRanks = sorted(positionRanks, key=lambda k: k['AVG'])
	for x in range(len(positionRanks)):
		positionRanks[x]['key'] = x + 1


def AllFix(dataset):
	fixPositionRanks(dataset)
	fixPositionMetrics(dataset)
	fixKey(dataset)
	return dataset


def ByPositions(dataset):
	positionsObject = {}
	hold = []
	for pos in ['QB','RB', 'WR', 'TE', 'DEF', 'K']:
		for x in range(len(dataset)):
			if dataset[x]['pos'] == pos:
				hold.append(dataset[x])
		fixPositionRanks(hold)
		fixPositionMetrics(hold)
		fixKey(hold)
		positionsObject[pos] = hold
		hold = []
	return positionsObject




